import math
import numpy as np

class Poly:
    def __init__(self, coeff):
        """
        coeff: (m,)
        m: # of coefficients of this polynomial
        coeff[j]: coefficient of the term of x^{m-1-j} of this polynomial
        i = 0, 1, ..., n-1
        """
        self.coeff = np.asarray(coeff)   # just self.coeff = coeff
        assert(self.ndim == 1)
        self.m = self.coeff.shape[0]
        assert(self.m > 0)
        
    def eval(self, _x):
        _x = np.asarray(_x)
        v = self.coeff[0]
        for i in range(1, self.m):
            v = v*_x + self.coeff[i]
        return v

    def evalD(self, _x):
        _x = np.asarray(_x)
        deg = self.m - 1
        v = deg*(self.coeff[0])
        for i in range(1, deg):
            v = v*_x + self.coeff[i]*(deg-i)
 
        return v

    def getDeriv(self):
        deg = self.m - 1         # degree
        if(deg <= 0):
            return Poly([0])

        coeff_d = []
        for i in range(deg):
            coeff_d.append( (deg-i)*self.coeff[i] )
        return Poly(coeff_d)

class PolyList:
    def __init__(self, coeff):
        """
        coeff: (n, m)
        n: # of polynomials
        m: # of coefficients of each polynomial
        coeff[i,j]: coefficient of the term of x^{m-1-j} of i-th polynomial
        i = 0, 1, ..., n-1
        j = 0, 1, ..., m-1
        """
        self.coeff = np.asarray(coeff)
        self.n, self.m = self.coeff.shape[:2]
        
        
    def eval(self, _x):
        """
        res: (_x.shape, self.n)
        """
        _x = np.expand_dims(_x, -1) # (_x.shape, 1)
        
        v = self.coeff[:,0]         # (self.n,)
        for i in range(1,self.m):
            v = v*_x + self.coeff[:,i] # (_x.shape, self.n)
        return v

    def evalD(self, _x):
        _x = np.expand_dims(_x, -1) # (_x.shape, 1)
        
        deg = self.m - 1
        v = deg*(self.coeff[:,0])
        for i in range(1, deg):
            v = v*_x + self.coeff[:,i]*(deg-i)
        return v

    def getDeriv(self):
        deg = self.m - 1     # degree
        if(deg <= 0):
            return PolyList(np.zeros_like(self.coeff))

        coeff_d = []
        for i in range(deg):
            coeff_d.append( (deg-i)*self.coeff[:,i] )
        return PolyList(np.asarray(coeff_d).T)

